import React from 'react'
import HOC from './HOC'
import Hello from './Hello'


const App4 = () => {
  return (
    <>
        <h1 style={{textAlign : "center"}}>HOC</h1>
        <HOC cmp={Hello}/>         
    </>
  )
}




export default App4
